import React from 'react';
import logo from './commons/images/logo.jpg';
import { Nav, Navbar, NavbarBrand, UncontrolledDropdown, DropdownToggle, DropdownMenu, DropdownItem } from 'reactstrap';
import { Link } from 'react-router-dom';
import { Line } from 'react-chartjs-2';

const LineChart = () => {
    const data = {
        labels: ['1', '2', '3', '4', '5', '6', '7'],
        datasets: [
            {
                label: 'Energy Consumption (kWh)',
                fill: false,
                lineTension: 0.1,
                backgroundColor: 'rgba(75,192,192,0.4)',
                borderColor: 'rgba(75,192,192,1)',
                borderCapStyle: 'butt',
                borderDash: [],
                borderDashOffset: 0.0,
                borderJoinStyle: 'miter',
                pointBorderColor: 'rgba(75,192,192,1)',
                pointBackgroundColor: '#fff',
                pointBorderWidth: 1,
                pointHoverRadius: 5,
                pointHoverBackgroundColor: 'rgba(75,192,192,1)',
                pointHoverBorderColor: 'rgba(220,220,220,1)',
                pointHoverBorderWidth: 2,
                pointRadius: 1,
                pointHitRadius: 10,
                data: [65, 59, 80, 81, 56, 55, 40]
            }
        ]
    };

    return <Line data={data} />;
};

const textStyle = {
    color: 'white',
    textDecoration: 'none'
};

const NavigationBar2 = () => (
    <div>
        <Navbar color="dark" light expand="md">
            <NavbarBrand href="/client/home1">
                <img src={logo} width={"50"} height={"35"} alt="Logo" />
            </NavbarBrand>
            <Nav className="mr-auto" navbar>
                <UncontrolledDropdown nav inNavbar>
                    <DropdownToggle style={textStyle} nav caret>
                        Menu
                    </DropdownToggle>
                    <DropdownMenu right>
                        <DropdownItem>
                            <Link to="/client/device" style={textStyle}>My Devices</Link>
                        </DropdownItem>
                    </DropdownMenu>
                </UncontrolledDropdown>
            </Nav>
        </Navbar>
        <div>
            <h2>Energy Consumption Chart</h2>
            <LineChart />
        </div>
    </div>
);

export default NavigationBar2;
